INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (100101, "ヒヨリ", 16, "人助けが大好き！　前向き格闘娘", 2, "獣人族", "A", "東山奈央", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 8, 155, "人助け、応援", 0, 44, "トゥインクルウィッシュ", 27);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (100201, "ユイ", 17, "戦闘のサポートが得意な、心優しい少女", 2, "ヒューマン", "O", "種田梨沙", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 4, 158, "料理、人間観察", 0, 47, "トゥインクルウィッシュ", 5);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (100301, "レイ", 18, "クールで何事にも真っ直ぐな剣士", 2, "魔族", "B", "早見沙織", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 1, 163, "読書、乗馬、お茶", 0, 46, "トゥインクルウィッシュ", 12);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (100401, "ミソギ", 9, "探検好きのイタズラっ子", 5, "ヒューマン", "O", "諸星すみれ", "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 8, 128, "いたずら、探検", 0, 27, "リトルリリカル", 10);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (100501, "マツリ", 12, "ヒーローに憧れる騎士見習いの少女", 8, "獣人族", "O", "下田麻美", "？？？", 11, 146, "ヒーローごっこ", 0, 40, "王宮騎士団（NIGHTMARE）", 25);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (100601, "アカリ", 13, "甘え上手なみんなの人気者", 7, "魔族", "O", "浅倉杏美", "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 11, 150, "サックス", 0, 42, "悪魔偽王国軍（ディアボロス）", 22);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (100701, "ミヤコ", 14, "プリン大好きゴースト娘", 7, "魔族", "B", "雨宮天", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 1, 130, "プリンを食べること", 0, 32, "悪魔偽王国軍（ディアボロス）", 23);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (100801, "ユキ", 14, "ボクは誰よりも美しい", 15, "エルフ", "AB", "大空直美", "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 10, 150, "鏡で自分を見ること", 0, 40, "ヴァイスフリューゲル　ランドソル支部", 10);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (100901, "アンナ", 17, "前世を信じる中二病患者、「疾風の冥姫」", 13, "魔族", "A", "髙野麻美", "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 7, 159, "小説執筆", 0, 45, "トワイライトキャラバン", 5);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (101001, "マホ", 16, "マホマホ王国のプリンセス", 10, "獣人族", "O", "内田真礼", "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 9, 155, "空想、ぬいぐるみ集め", 0, 42, "自警団（カォン）", 22);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (101101, "リノ", 15, "人懐っこくてマシンガントークな妹系少女", 3, "ヒューマン", "A", "阿澄佳奈", "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 8, 156, "お裁縫", 0, 44, "ラビリンス", 25);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (101201, "ハツネ", 17, "みんなのために超能力を使う眠り姫", 6, "エルフ", "A", "大橋彩香", "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 12, 156, "妹と遊ぶこと、二度寝、昼寝、早寝", 0, 46, "フォレスティエ", 24);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (101301, "ナナカ", 18, "オタク全開な魔法少女", 13, "魔族", "O", "佳村はるか", "", 8, 166, "読書、魔法", 0, 55, "トワイライトキャラバン", 21);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (101401, "カスミ", 15, "頭脳明晰な美少女名探偵", 10, "獣人族", "AB", "水瀬いのり", "test", 11, 152, "読書、推理", 0, 41, "自警団（カォン）", 3);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (101501, "ミサト", 21, "母性溢れる優しいみんなの「ミサト先生」", 6, "エルフ", "O", "國府田マリ子", "test", 9, 165, "絵本作り", 0, 54, "フォレスティエ", 5);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (101601, "スズナ", 18, "天真爛漫で人気者のカリスマモデル", 14, "魔族", "O", "上坂すみれ", "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 4, 167, "ファッション", 0, 48, "ルーセント学院", 10);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (101701, "カオリ", 19, "いつでも「なんくるないさ～」な天然娘", 10, "獣人族", "A", "高森奈津美", "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 7, 158, "踊り、空手", 0, 53, "自警団（カォン）", 7);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (101801, "イオ", 23, "多くの男性を魅了する無垢な女教師", 14, "魔族", "B", "伊藤静", "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 8, 162, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 0, 52, "ルーセント学院", 14);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (102001, "ミミ", 10, "お歌もにんじんも、ウサギさんも大好き♪", 5, "獣人族", "O", "日高里菜", "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 4, 117, "かわいいもの集め", 0, 21, "リトルリリカル", 3);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (102101, "クルミ", 12, "泣き虫で臆病な守ってあげたい女の子", 9, "ヒューマン", "B", "植田佳奈", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 6, 150, "観劇、おままごと", 0, 40, "サレンディア救護院", 9);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (102201, "ヨリ", 13, "人見知りであまのじゃくな女の子", 7, "魔族", "O", "原紗友里", "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 11, 150, "ゲーム全般", 0, 40, "悪魔偽王国軍（ディアボロス）", 22);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (102301, "アヤネ", 14, "ぷうきちといつも一緒！", 9, "ヒューマン", "B", "芹澤優", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 5, 148, "屋内でできる遊び", 0, 38, "サレンディア救護院", 10);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (102501, "スズメ", 15, "お嬢さまのためにがんばるドジっ娘メイド", 9, "ヒューマン", "O", "悠木碧", "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 12, 154, "ご奉仕", 0, 43, "サレンディア救護院", 12);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (102601, "リン", 17, "遊びと睡眠が何より大事なぐうたら娘", 11, "獣人族", "B", "小岩井ことり", "test", 1, 144, "あんパン", 0, 42, "牧場（エリザベスパーク）", 1);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (102701, "エリコ", 16, "運命の相手に一途すぎる乙女", 13, "魔族", "B", "橋本ちなみ", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 7, 154, "実験、裁縫、料理", 0, 43, "トワイライトキャラバン", 30);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (102801, "サレン", 17, "救護院を経営する優しい庶民派お嬢様", 9, "エルフ", "A", "堀江由衣", "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 10, 156, "経営、お茶会", 0, 43, "サレンディア救護院", 4);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (102901, "ノゾミ", 17, "歌って踊れる大人気アイドル", 4, "ヒューマン", "B", "日笠陽子", "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 1, 157, "舞台鑑賞、ダンス", 0, 40, "カルミナ", 24);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (103001, "ニノン", 16, "トーゴクの神秘、オシエテクダサイ！", 15, "ヒューマン", "O", "佐藤聡美", "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 8, 163, "忍法開発", 0, 51, "ヴァイスフリューゲル　ランドソル支部", 31);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (103101, "シノブ", 18, "占いが得意な霊能少女", 7, "魔族", "AB", "大坪由佳", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 12, 157, "占い", 0, 42, "悪魔偽王国軍（ディアボロス）", 22);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (103201, "アキノ", 18, "一人前の商人を目指すパワフルお嬢様", 12, "ヒューマン", "AB", "松嵜麗", "この私とともにいる限り、\nお金に不自由はさせませんわ！", 3, 157, "慈善事業", 0, 45, "メルクリウス財団", 12);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (103301, "マヒル", 20, "みんなを笑顔にするお笑い牧場主", 11, "ヒューマン", "B", "新田恵海", "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 3, 142, "漫才", 0, 35, "牧場（エリザベスパーク）", 3);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (103401, "ユカリ", 22, "純情でほっとけない大人の女性", 12, "エルフ", "A", "今井麻美", "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 3, 164, "ウインドーショッピング", 0, 55, "メルクリウス財団", 16);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (103601, "キョウカ", 8, "礼儀正しくしっかり者のちびっ子優等生", 5, "エルフ", "A", "小倉唯", "test", 2, 118, "お勉強", 0, 21, "リトルリリカル", 2);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (103701, "トモ", 13, "義理堅くてからかい好きな剣術少女", 8, "ヒューマン", "A", "茅原実里", "test", 8, 149, "剣術、年長者をからかう", 0, 43, "王宮騎士団（NIGHTMARE）", 11);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (103801, "シオリ", 14, "読書が趣味の病弱少女", 11, "獣人族", "A", "小清水亜美", "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 11, 153, "読書、お散歩", 0, 40, "牧場（エリザベスパーク）", 3);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (104001, "アオイ", 13, "「友達」に憧れる、エルフの森の女の子", 6, "エルフ", "AB", "花澤香菜", "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 6, 158, "友達作りのイメトレ", 0, 44, "フォレスティエ", 6);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (104201, "チカ", 17, "人々を守るために歌う、唱喚士の少女", 4, "ヒューマン", "O", "福原綾香", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 6, 163, "各種楽器", 0, 46, "カルミナ", 3);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (104301, "マコト", 17, "男勝りで情に厚いワイルド娘", 10, "獣人族", "O", "小松未可子", "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 8, 168, "お菓子作り", 0, 54, "自警団（カォン）", 9);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (104401, "イリヤ", "??", "かつては夜を支配した最強の吸血鬼", 7, "魔族", "A", "丹下桜", "test", 5, 172, "世界征服", 0, 50, "悪魔偽王国軍（ディアボロス）", 5);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (104501, "クウカ", 18, "妄想大好き！　ほんとは照れ屋な女の子", 15, "ヒューマン", "AB", "長妻樹里", "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 11, 157, "小説を読むこと", 0, 49, "ヴァイスフリューゲル　ランドソル支部", 19);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (104601, "タマキ", 18, "弱きを助け強きをくじく猫娘", 12, "獣人族", "AB", "沼倉愛美", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 3, 158, "猫とたわむれること", 0, 48, "メルクリウス財団", 1);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (104701, "ジュン", 25, "素顔を見せない冷静沈着な女性騎士", 8, "ヒューマン", "A", "川澄綾子", "？？？", 10, 171, "格闘技、湯浴み", 0, 50, "王宮騎士団（NIGHTMARE）", 25);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (104801, "ミフユ", 20, "仕事も私事も効率優先な傭兵少女", 12, "ヒューマン", "O", "田所あずさ", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 11, 163, "傭兵などのアルバイト", 0, 49, "メルクリウス財団", 11);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (104901, "シズル", 18, "お姉ちゃんがお世話してあげるからねっ！", 3, "ヒューマン", "O", "生天目仁美", "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 10, 168, "家事全般", 0, 54, "ラビリンス", 24);
