INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (105101, "ミツキ", 27, "実験が趣味の危険な科学者", 13, "ヒューマン", "A", "三石琴乃", "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 3, 166, "研究、実験", 0, 53, "トワイライトキャラバン", 7);
