INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (108401, "チカ（クリスマス）", 17, "人々を守るために歌う、唱喚士の少女", 4, "ヒューマン", "O", "福原綾香", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 6, 163, "各種楽器", 0, 46, "カルミナ", 3);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (108501, "クルミ（クリスマス）", 12, "泣き虫で臆病な守ってあげたい女の子", 9, "ヒューマン", "B", "植田佳奈", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 6, 150, "観劇、おままごと", 0, 40, "サレンディア救護院", 9);
