INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (109001, "エリコ（バレンタイン）", 16, "運命の相手に一途すぎる乙女", 13, "魔族", "B", "橋本ちなみ", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 7, 154, "実験、裁縫、料理", 0, 43, "トワイライトキャラバン", 30);
